apiVersion: machineconfiguration.openshift.io/v1
kind: MachineConfig
metadata:
  labels:
    machineconfiguration.openshift.io/role: worker
  name: 50-worker-qemu-guest-agent
spec:
  config:
    ignition:
      version: 2.2.0
    storage:
      files:
      - contents:
          source: data:text/plain;charset=utf-8;base64,
        filesystem: root
        mode: 0755
        path: /etc/qemu-ga/fsfreeze-hook
      - contents:
          source: data:text/plain;charset=utf-8;base64,
        filesystem: root
        mode: 0644
        path: /etc/sysconfig/qemu-ga
      - contents:
          source: data:text/plain;charset=utf-8;base64,U1VCU1lTVEVNPT0idmlydGlvLXBvcnRzIiwgQVRUUntuYW1lfT09Im9yZy5xZW11Lmd1ZXN0X2FnZW50LjAiLCBcCiAgVEFHKz0ic3lzdGVtZCIgRU5We1NZU1RFTURfV0FOVFN9PSJxZW11LWd1ZXN0LWFnZW50LnNlcnZpY2UiCg==
        filesystem: root
        mode: 0644
        path: /etc/udev/rules.d/99-qemu-guest-agent.rules
      - contents:
          source: data:text/plain;charset=utf-8;base64,
        filesystem: root
        mode: 0755
        path: /opt/qemu-guest-agent/bin/qemu-ga
    systemd:
      units:
      - name: qemu-guest-agent-selinux.service
        enabled: true
        contents: |-
          [Unit]
          Before=qemu-guest-agent.service
          DefaultDependencies=no
          
          [Service]
          Type=oneshot
          ExecStartPre=/bin/bash -c 'while [ ! -f /opt/qemu-guest-agent/bin/qemu-ga ]; do /usr/bin/sleep 5; done'
          TimeoutStartSec=300
          ExecStart=/usr/bin/chcon -t bin_t /opt/qemu-guest-agent/bin/qemu-ga
          
          [Install]
          WantedBy=multi-user.target

      - name: qemu-guest-agent.service
        enabled: true
        contents: |-
          [Unit]
          Description=QEMU Guest Agent
          BindsTo=dev-virtio\x2dports-org.qemu.guest_agent.0.device
          Requires=qemu-guest-agent-selinux.service
          After=dev-virtio\x2dports-org.qemu.guest_agent.0.device
          After=qemu-guest-agent-selinux.service
          IgnoreOnIsolate=True
          
          [Service]
          UMask=0077
          EnvironmentFile=/etc/sysconfig/qemu-ga
          ExecStart=/opt/qemu-guest-agent/bin/qemu-ga \
            -vvv \
            --method=virtio-serial \
            --path=/dev/virtio-ports/org.qemu.guest_agent.0 \
            --blacklist=${BLACKLIST_RPC} \
            -F${FSFREEZE_HOOK_PATHNAME}
          StandardError=syslog
          Restart=always
          RestartSec=30
          
          [Install]
          WantedBy=dev-virtio\x2dports-org.qemu.guest_agent.0.device
